function UnitType () {
    const unitTypes = ['Length', 'Mass', 'Volume', 'Time', 'Temp']
    return  (
        <div className='unitType-container'>
            {unitTypes.map(item => {
                <h2>{item}</h2>
            })}
        </div>
    )
}

export default UnitType;
